import styles from '../articles.module.css';

const teamNfo = (props) =>(
    <div className={styles.articleTeamHeader}>
        <div className={styles.left} 
            styles={{
                background:`url('/image/teams/${props.team.logo}')`
            }}
        >
        </div>
    </div>
)
export default teamNfo;
